        const colorMap = {"Python":"#e41a1c","JavaScript":"#377eb8","Unknown":"#4daf4a","TypeScript":"#984ea3","C++":"#ff7f00","Java":"#ffff33","Go":"#a65628","C":"#f781bf","C#":"#999999","PHP":"#66c2a5","Jupyter Notebook":"#fc8d62","Shell":"#8da0cb","HTML":"#e78ac3","Rust":"#a6d854","Swift":"#ffd92f","Other":"#cccccc"};
